import React,{Component} from 'react';
class Contact extends Component {
  render() {
      
      const {name,email} =this.props;
      //or even using this.props.branding also works, but destructuring makes the code cleaner.
      return(
          
                    <div className="App">
                    <h1>{name}</h1>
                      <ul>
                      <li>Email : {email}</li>
                      </ul>
                    </div>
            )
      
  }
}

export default Contact;
